// frontend/src/pages/AllMaintenanceLogs.js

import React, { useEffect, useState } from "react";
import axios from "axios";
import { Table } from "react-bootstrap";

const AllMaintenanceLogs = () => {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const res = await axios.get("/api/maintenance/all-logs");
        setLogs(res.data);
      } catch (err) {
        console.error("Failed to fetch maintenance logs:", err);
      }
    };

    fetchLogs();
  }, []);

  return (
    <div className="container mt-5">
      <h2 className="mb-4">
        ðŸ§¾ <strong>All Maintenance Logs</strong>
      </h2>

      <Table striped bordered hover responsive>
        <thead>
          <tr>
            <th>Asset Name</th>
            <th>Location</th>
            <th>Type</th>
            <th>Notes</th>
            <th>Scheduled Date</th>
            <th>Assigned To</th>
            <th>Created At</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log) => (
            <tr key={log._id}>
              <td>{log.asset?.assetName || "N/A"}</td>
              <td>{log.asset?.location || "N/A"}</td>
              <td>{log.type}</td>
              <td>{log.notes}</td>
              <td>{new Date(log.scheduledDate).toLocaleDateString()}</td>
              <td>
                {log.assignedTo
                  ? `${log.assignedTo.firstName} ${log.assignedTo.lastName}`
                  : "N/A"}
              </td>
              <td>{new Date(log.createdAt).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default AllMaintenanceLogs;
